}
autocomplete-suggestion-list .icon.selector {
  color: #dda2f6;
  background: rgba(221, 162, 246, 0.2);
}
autocomplete-suggestion-list .icon.pseudo-selector {
  color: #dda2f6;
  background: rgba(221, 162, 246, 0.2);
}
